import React from "react";

function Body({ searchResult }) {
  return (
    <main>
      {searchResult ? (
        <p>Resultado da pesquisa: {searchResult}</p>
      ) : (
        <p>Nenhuma pesquisa realizada ainda.</p>
      )}
    </main>
  );
}

export default Body;
